		return(
		<BaseLayout>
		  	<h1>Welcome to Index Page</h1>
		  	<h2>{ title }</h2>	
		  	<button onClick={this.updateTitle}>Change Title</button>
	  	</BaseLayout>
	  	)
	}
}
export default Index;
